import logo from './logo.svg';
import './App.css';
import {Routes, Route,Link, useNavigate} from "react-router-dom";
import Modal from './modiary.js';
import Home from "./Home.js";
import Notice from "./Notice.js";
import React, {useEffect, useState} from "react"
import axios from "axios"

function History() {
  const [diary, setDiary] = useState([]);
  const [page, setPage] = useState(1);
  const navigate = useNavigate();



  // useEffect(() => {
  //   const fetchDiary = async () => {
  //     try {
  //       const response = await fetch('https://codingapple1.github.io/shop/data3.json');
  //       const data = await response.json();
  //       setDiary(data);
  //     } catch (error) {
  //       console.error('오류남', error);
  //     }};

    // fetchDiary();
    // }, [];


  useEffect(() => {
    fetchDiary();
  }, []);

  const fetchDiary = async () => {
    const data = await (
      await axios.get("https://codingapple1.github.io/shop/data2.json")
    ).data;
    setDiary(data);
    console.log(userInformation);
  };

    fetchDiary();





    return (
      <>
      <div className="App">
        <div>
          <h5>
          {diary.id}님,<br />
            환영합니다.<br /><br />
            <div className="one"></div>
          </h5>
          
          <ul className="navigation-menu">
            <li><Link to="/Home">홈</Link></li><br />
            <li><Link to="/Notice">게시판</Link></li><br />
            <li><div className="click">히스토리</div></li><br />
          </ul>
          
          <Routes>
            <Route path="/Home" element={<Home />}></Route>
            <Route path="/Notice" element={<Notice />}></Route>
          </Routes>
        </div>
  
        <h1>
          Your history!
        </h1>
        
        <div>
        <ul className="history_total">
          {diary.map((diary, index) => {
            <div key={index}>
              <li className="history" >{diary.title}</li><br />
              <li className="history" >{diary.content}</li><br />
              <li className="history" >{diary.price}</li><br />
            </div>
            })}
        </ul>
        </div>

        {/* 7개씩 데이터를 뜨게 하는 코드 */}
        {/* {diary.map((a, i) => {
            return <Card diary ={i} key={i}></Card>
          })} */}
        
        <div className ="nextbutton">
          <button onClick={() => setPage(page - 1)} disabled={page === 1}>
            이전 페이지 
          </button>
          <button onClick={() => setPage(page + 1)}>
            다음 페이지
          </button>
        </div>
    </div>
      </>
    );
  }


export default History;
